import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";
import Navbar from "../components/Navbar";
import Sidebar from "../components/Sidebar";

export default function StudentHome() {
  const [code, setCode] = useState("");
  const navigate = useNavigate();

  const goToQuiz = () => {
    const trimmed = code.trim();
    if (!trimmed || trimmed.length !== 4 || isNaN(trimmed)) {
      alert("Please enter a valid 4-digit code!");
      return;
    }
    navigate(`/quiz/${trimmed}`);
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") goToQuiz();
  };

  return (
    <>
      {/* Navbar + Sidebar (Logout already in Navbar) */}
      <Navbar />
      <div className="container-row">
        <Sidebar />

        {/* Main Content */}
        <div style={{
          flex: 1,
          background: "#000",
          minHeight: "100vh",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          position: "relative",
          overflow: "hidden"
        }}>
          {/* Background Glow */}
          <div style={{
            position: "absolute",
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: "radial-gradient(circle at 30% 70%, rgba(255,107,53,0.3) 0%, transparent 50%), radial-gradient(circle at 70% 30%, rgba(255,105,180,0.3) 0%, transparent 50%)",
            filter: "blur(100px)",
            opacity: 0.6
          }} />

          {/* Main Card */}
          <motion.div
            initial={{ scale: 0.9, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            transition={{ duration: 0.7 }}
            style={{
              background: "rgba(20, 20, 20, 0.95)",
              padding: "70px 90px",
              borderRadius: "30px",
              boxShadow: "0 0 100px rgba(255, 107, 53, 0.5), 0 0 150px rgba(255, 105, 180, 0.4)",
              border: "3px solid #333",
              textAlign: "center",
              maxWidth: "700px",
              backdropFilter: "blur(15px)",
              position: "relative",
              zIndex: 10
            }}
          >
            {/* Title */}
            <motion.h1
              initial={{ y: -60 }}
              animate={{ y: 0 }}
              style={{
                fontSize: "82px",
                fontWeight: "900",
                margin: "0 0 25px 0",
                background: "linear-gradient(45deg, #ff6b35, #ff4500)",
                WebkitBackgroundClip: "text",
                WebkitTextFillColor: "transparent",
                letterSpacing: "8px",
                textShadow: "0 0 50px rgba(255,107,53,0.8)",
                lineHeight: "1"
              }}
            >
              ENTER QUIZ CODE
            </motion.h1>

            <motion.p
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.6 }}
              style={{
                color: "#ff6b35",
                fontSize: "24px",
                margin: "25px 0 60px",
                fontWeight: "bold",
                letterSpacing: "1px"
              }}
            >
              Only players with the code may enter.
            </motion.p>

            {/* Input + Button */}
            <div style={{ display: "flex", gap: "25px", justifyContent: "center", alignItems: "center", flexWrap: "wrap" }}>
              <motion.input
                whileFocus={{ scale: 1.05, boxShadow: "0 0 40px #00ffcc" }}
                type="text"
                maxLength="4"
                value={code}
                onChange={(e) => setCode(e.target.value.replace(/\D/g, ""))}
                onKeyPress={handleKeyPress}
                placeholder="Enter 4-digit code"
                style={{
                  padding: "22px 35px",
                  fontSize: "32px",
                  width: "320px",
                  background: "#0a0a0a",
                  color: "#00ffcc",
                  border: "2px solid #333",
                  borderRadius: "16px",
                  textAlign: "center",
                  letterSpacing: "10px",
                  fontWeight: "bold",
                  outline: "none",
                  boxShadow: "0 0 30px rgba(0,255,204,0.3)",
                  transition: "all 0.4s"
                }}
              />

              <motion.button
                whileHover={{ scale: 1.12, boxShadow: "0 0 60px #ff6b35" }}
                whileTap={{ scale: 0.95 }}
                onClick={goToQuiz}
                style={{
                  padding: "22px 55px",
                  fontSize: "26px",
                  background: "#ff6b35",
                  color: "white",
                  border: "none",
                  borderRadius: "16px",
                  fontWeight: "bold",
                  cursor: "pointer",
                  boxShadow: "0 0 50px #ff6b35",
                  textTransform: "uppercase",
                  letterSpacing: "3px"
                }}
              >
                Start Quiz
              </motion.button>
            </div>

            {/* Warning */}
            <motion.p
              initial={{ opacity: 0 }}
              animate={{ opacity: 0.8 }}
              transition={{ delay: 1 }}
              style={{
                marginTop: "50px",
                color: "#ff3366",
                fontSize: "18px",
                fontWeight: "bold"
              }}
            >
              Warning: Once you enter, there is no turning back.
            </motion.p>
          </motion.div>

          {/* LOGOUT BUTTON - ONLY ONE TIME (FROM NAVBAR) */}
          {/* NO EXTRA LOGOUT HERE - ALREADY IN NAVBAR */}
        </div>
      </div>
    </>
  );
}
